// SPDX-License-Identifier: MIT

pragma solidity ^0.8.19;

import {PriceConverter} from "./PriceConvert.sol";


error notowner();
    contract fundme {
        using  PriceConverter for uint256;

        uint256 public constant minUsd = 5e18;
        address[] public funders;
        mapping (address funders => uint256 amountFundedBy) public amountFundedBy;

        address public immutable owner;
        constructor() {
            owner = msg.sender;
        } 

        function fund() public payable  {
        require(msg.value.getConversionRate() >= minUsd , "not even eth");
        funders.push(msg.sender);
        amountFundedBy[msg.sender] += msg.value ;
        }
        function withdraw() public onlyOwner {
            for (uint256 funderIndex; funderIndex < funders.length; funderIndex++) 
            {
                address funder = funders[funderIndex];
                amountFundedBy[funder] = 0;
            }
            funders = new address[](0);
            // //transfer
            // payable (msg.sender).transfer(address(this).balance);
            // // send
            // bool sendSuccess = payable (msg.sender).send(address(this).balance);
            // require(sendSuccess,"send fail");
            //call
            (bool callSuccess, ) = address(msg.sender).call{value : address(this).balance}("");
            require(callSuccess,"call fail");
        }

        modifier onlyOwner(){
            // require(msg.sender == owner , 'you are not the owner of the contract');
            if (msg.sender != owner) revert notowner();
            _;
        }
        receive() external payable {
            fund();
         }
         fallback() external payable {
            fund();
          }
    }

